- contents:
  - "                      The Unicode Code Points and\n         Internationalized
    Domain Names for Applications (IDNA)\n"
  title: __initial_text__
- contents:
  - "Abstract\n   This document specifies rules for deciding whether a code point,\n
    \  considered in isolation or in context, is a candidate for inclusion\n   in
    an Internationalized Domain Name (IDN).\n   It is part of the specification of
    Internationalizing Domain Names in\n   Applications 2008 (IDNA2008).\n"
  title: Abstract
