- contents:
  - "1.  Introduction\n   RFC 4690 [RFC4690] suggests an inclusion-based approach
    for selecting\n   the code points from The Unicode Standard [Unicode52] that should
    be\n   included in the list of code points that may be used in\n   Internationalized
    Domain Names.\n   Specifically, RFC 4690 [RFC4690] says the following:\n      The
    IAB has concluded that there is a consensus within the broader\n      community
    that lists of code points should be specified by the use\n      of an inclusion-based
    mechanism (i.e., identifying the characters\n      that are permitted), rather
    than by excluding a small number of\n      characters from the total Unicode set
    as Stringprep [RFC3454] and\n      Nameprep [RFC3491] do today.  That conclusion
    should be reviewed\n      by the IETF community and action taken as appropriate.\n
    \  This document reviews and classifies the collections of code points\n   in
    the Unicode character set by examining various properties of the\n   code points.
    \ It then defines an algorithm for determining a derived\n   property value.  It
    specifies a procedure, and not a table, of code\n   points so that the algorithm
    can be used to determine code point sets\n   independent of the version of Unicode
    that is in use.\n   This document is not intended to specify precisely how these
    property\n   values are to be applied in IDN labels.  That information appears
    in\n   the Protocol document [RFC5891], but it is important to understand\n   that
    the assignment of a value of this property to a particular\n   character is not
    sufficient to determine whether it can be used in a\n   given label.  In particular,
    some combinations of allowed code points\n   are not advisable for use in IDNs
    due to rules specific to a script\n   or class of characters.  The requirement
    for such rules is linked to\n   the operations in the Protocol document and especially
    to the\n   characters designated as requiring contextual rules.\n   The value
    of the property is to be interpreted as follows.\n   o  PROTOCOL VALID: Those
    that are allowed to be used in IDNs.  Code\n      points with this property value
    are permitted for general use in\n      IDNs.  However, that a label consists
    only of code points that\n      have this property value does not imply that the
    label can be used\n      in DNS.  See the Protocol document for algorithms to
    make\n      decisions about labels in domain names.  The abbreviated term\n      PVALID
    is used to refer to this value in the rest of this\n      document.\n   o  CONTEXTUAL
    RULE REQUIRED: Some characteristics of the character,\n      such as it being
    invisible in certain contexts or problematic in\n      others, require that it
    not be used in labels unless specific\n      other characters or properties are
    present.  The abbreviated term\n      CONTEXT is used to refer to this value in
    the rest of this\n      document.  There are two subdivisions of CONTEXTUAL RULE
    REQUIRED,\n      one for Join_controls (called CONTEXTJ) and for other characters\n
    \     (called CONTEXTO).  These are discussed in more detail below and\n      in
    the Protocol document.\n   o  DISALLOWED: Those that should clearly not be included
    in IDNs.\n      Code points with this property value are not permitted in IDNs.\n
    \  o  UNASSIGNED: Those code points that are not designated (i.e., are\n      unassigned)
    in the Unicode Standard.\n   The mechanisms described here allow determination
    of the value of the\n   property for future versions of Unicode (including characters
    added\n   after Unicode 5.2).  Changes in Unicode properties that do not affect\n
    \  the outcome of this process do not affect IDN.  For example, a\n   character
    can have its Unicode General_Category value (see\n   [Unicode52]) change from
    So to Sm or from Lo to Ll, without affecting\n   the algorithm results.  Moreover,
    even if such changes were the\n   result, the BackwardCompatible list (Section
    2.7) can be adjusted to\n   ensure the stability of the results.\n   Some code
    points need to be allowed in exceptional circumstances but\n   should be excluded
    in all other cases; these rules are also described\n   in other documents.  The
    most notable of these are the Join Control\n   characters, U+200D ZERO WIDTH JOINER
    and U+200C ZERO WIDTH\n   NON-JOINER.  Both of them have the derived property
    value CONTEXTJ.\n   A character with the derived property value CONTEXTJ or CONTEXTO\n
    \  (CONTEXTUAL RULE REQUIRED) is not to be used unless an appropriate\n   rule
    has been established and the context of the character is\n   consistent with that
    rule.  It is invalid to either register a string\n   containing these characters
    or even to look one up unless such a\n   contextual rule is found and satisfied.
    \ Please see Appendix A, \"The\n   Contextual Rules Registry\", for more information.\n
    \  This document is part of a series that, together, constitute a\n   proposal
    for updating the IDNA standards to resolve issues uncovered\n   in recent years,
    cover a broader range of scripts, and provide for\n   migration to newer versions
    of Unicode.  See the Rationale document\n   [RFC5894] for a broader discussion.\n
    \  The key words \"MUST\", \"MUST NOT\", \"REQUIRED\", \"SHALL\", \"SHALL NOT\",\n
    \  \"SHOULD\", \"SHOULD NOT\", \"RECOMMENDED\", \"MAY\", and \"OPTIONAL\" in this\n
    \  document are to be interpreted as described in RFC 2119 [RFC2119].\n"
  title: 1.  Introduction
- contents:
  - "2.  Category Definitions Used to Calculate Derived Property Value\n   The derived
    property obtains its value based on a two-step procedure.\n   First, characters
    are placed in one or more character categories\n   based on either core properties
    defined by the Unicode Standard or by\n   treating the code point as an exception
    and addressing the code point\n   by its code point value.  These categories are
    not mutually\n   exclusive.\n   In the second step, set operations are used with
    these categories to\n   determine the values for an IDN-specific property.  Those
    operations\n   are specified in Section 3.\n   Unicode property names and property
    value names may have short\n   abbreviations, such as gc for the General_Category
    property, and Ll\n   for the Lowercase_Letter property value of the gc property.\n
    \  In the following specification of categories, the operation that\n   returns
    the value of a particular Unicode character property for a\n   code point is designated
    by using the formal name of that property\n   (from PropertyAliases.txt) followed
    by '(cp)'.  For example, the\n   value of the General_Category property for a
    code point is indicated\n   by General_Category(cp).\n"
  title: 2.  Category Definitions Used to Calculate Derived Property Value
- contents:
  - "2.1.  LetterDigits (A)\n   A: General_Category(cp) is in {Ll, Lu, Lo, Nd, Lm,
    Mn, Mc}\n   These rules identify characters commonly used in mnemonics and often\n
    \  informally described as \"language characters\".  In general, only code\n   points
    assigned to this category are suitable for use in IDN.\n   For more information,
    see Section 4.5 of The Unicode Standard\n   [Unicode].\n   The categories used
    in this rule are:\n   o  Ll - Lowercase_Letter\n   o  Lu - Uppercase_Letter\n
    \  o  Lo - Other_Letter\n   o  Nd - Decimal_Number\n   o  Lm - Modifier_Letter\n
    \  o  Mn - Nonspacing_Mark\n   o  Mc - Spacing_Mark\n"
  title: 2.1.  LetterDigits (A)
- contents:
  - "2.2.  Unstable (B)\n   B: toNFKC(toCaseFold(toNFKC(cp))) != cp\n   This category
    is used to group the characters that are not stable\n   under Normalization Form
    K (NFKC) and case folding.  In general,\n   these code points are not suitable
    for use for IDN.\n   The toCaseFold() operation is defined in Section 3.13 of
    The Unicode\n   Standard [Unicode].\n   The toNFKC() operation returns the code
    point in normalization form\n   KC.  For more information, see Section 5 of Unicode
    Standard Annex\n   #15 [TR15].\n   It should be noted that NFKC is used, although
    Normalization Form C\n   (NFC) is used in the \"IDNA Protocol\" document [RFC5891].\n"
  title: 2.2.  Unstable (B)
- contents:
  - "2.3.  IgnorableProperties (C)\n   C: Default_Ignorable_Code_Point(cp) = True
    or\n      White_Space(cp) = True or\n      Noncharacter_Code_Point(cp) = True\n
    \  This category is used to group code points that are not recommended\n   for
    use in identifiers.  In general, these code points are not\n   suitable for use
    in an IDN.\n   The definition for Default_Ignorable_Code_Point can be found in\n
    \  DerivedCoreProperties.txt [DerivedCoreProperties] and is at the time\n   of
    Unicode 5.2:\n   Other_Default_Ignorable_Code_Point + Cf (Format characters)\n
    \  + Variation_Selector - White_Space - FFF9..FFFB (Annotation\n   Characters)
    - 0600..0603, 06DD, 070F (exceptional Cf characters\n   that should be visible)\n"
  title: 2.3.  IgnorableProperties (C)
- contents:
  - "2.4.  IgnorableBlocks (D)\n   D: Block(cp) is in {Combining Diacritical Marks
    for Symbols,\n                       Musical Symbols, Ancient Greek Musical Notation}\n
    \  This category is used to identify code points that are not useful in\n   mnemonics
    or that are otherwise impractical for IDN use.  In general,\n   these code points
    are not suitable for use for IDN.\n   The definition of blocks can be found in
    Blocks.txt [BlockNames].\n"
  title: 2.4.  IgnorableBlocks (D)
- contents:
  - "2.5.  LDH (E)\n   E: cp is in {002D, 0030..0039, 0061..007A}\n   This category
    is used in the second step to preserve the traditional\n   \"hostname\" (LDH --
    as described in the Definitions document\n   [RFC5890]) characters ('-', 0-9,
    and a-z).  In general, these code\n   points are suitable for use for IDN.  Note
    that there are other rules\n   regarding the code point U+002D HYPHEN-MINUS that
    are specified in\n   the IDNA Protocol Specification [RFC5891].\n"
  title: 2.5.  LDH (E)
- contents:
  - "2.6.  Exceptions (F)\n   F: cp is in {00B7, 00DF, 0375, 03C2, 05F3, 05F4, 0640,
    0660,\n                0661, 0662, 0663, 0664, 0665, 0666, 0667, 0668,\n                0669,
    06F0, 06F1, 06F2, 06F3, 06F4, 06F5, 06F6,\n                06F7, 06F8, 06F9, 06FD,
    06FE, 07FA, 0F0B, 3007,\n                302E, 302F, 3031, 3032, 3033, 3034, 3035,
    303B,\n                30FB}\n   This category explicitly lists code points for
    which the category\n   cannot be assigned using only the core property values
    that exist in\n   the Unicode standard.  The values are according to the table
    below:\n PVALID -- Would otherwise have been DISALLOWED\n 00DF; PVALID     # LATIN
    SMALL LETTER SHARP S\n 03C2; PVALID     # GREEK SMALL LETTER FINAL SIGMA\n 06FD;
    PVALID     # ARABIC SIGN SINDHI AMPERSAND\n 06FE; PVALID     # ARABIC SIGN SINDHI
    POSTPOSITION MEN\n 0F0B; PVALID     # TIBETAN MARK INTERSYLLABIC TSHEG\n 3007;
    PVALID     # IDEOGRAPHIC NUMBER ZERO\n CONTEXTO -- Would otherwise have been DISALLOWED\n
    00B7; CONTEXTO   # MIDDLE DOT\n 0375; CONTEXTO   # GREEK LOWER NUMERAL SIGN (KERAIA)\n
    05F3; CONTEXTO   # HEBREW PUNCTUATION GERESH\n 05F4; CONTEXTO   # HEBREW PUNCTUATION
    GERSHAYIM\n 30FB; CONTEXTO   # KATAKANA MIDDLE DOT\n CONTEXTO -- Would otherwise
    have been PVALID\n 0660; CONTEXTO   # ARABIC-INDIC DIGIT ZERO\n 0661; CONTEXTO
    \  # ARABIC-INDIC DIGIT ONE\n 0662; CONTEXTO   # ARABIC-INDIC DIGIT TWO\n 0663;
    CONTEXTO   # ARABIC-INDIC DIGIT THREE\n 0664; CONTEXTO   # ARABIC-INDIC DIGIT
    FOUR\n 0665; CONTEXTO   # ARABIC-INDIC DIGIT FIVE\n 0666; CONTEXTO   # ARABIC-INDIC
    DIGIT SIX\n 0667; CONTEXTO   # ARABIC-INDIC DIGIT SEVEN\n 0668; CONTEXTO   # ARABIC-INDIC
    DIGIT EIGHT\n 0669; CONTEXTO   # ARABIC-INDIC DIGIT NINE\n 06F0; CONTEXTO   #
    EXTENDED ARABIC-INDIC DIGIT ZERO\n 06F1; CONTEXTO   # EXTENDED ARABIC-INDIC DIGIT
    ONE\n 06F2; CONTEXTO   # EXTENDED ARABIC-INDIC DIGIT TWO\n 06F3; CONTEXTO   #
    EXTENDED ARABIC-INDIC DIGIT THREE\n 06F4; CONTEXTO   # EXTENDED ARABIC-INDIC DIGIT
    FOUR\n 06F5; CONTEXTO   # EXTENDED ARABIC-INDIC DIGIT FIVE\n 06F6; CONTEXTO   #
    EXTENDED ARABIC-INDIC DIGIT SIX\n 06F7; CONTEXTO   # EXTENDED ARABIC-INDIC DIGIT
    SEVEN\n 06F8; CONTEXTO   # EXTENDED ARABIC-INDIC DIGIT EIGHT\n 06F9; CONTEXTO
    \  # EXTENDED ARABIC-INDIC DIGIT NINE\n DISALLOWED -- Would otherwise have been
    PVALID\n 0640; DISALLOWED # ARABIC TATWEEL\n 07FA; DISALLOWED # NKO LAJANYALAN\n
    302E; DISALLOWED # HANGUL SINGLE DOT TONE MARK\n 302F; DISALLOWED # HANGUL DOUBLE
    DOT TONE MARK\n 3031; DISALLOWED # VERTICAL KANA REPEAT MARK\n 3032; DISALLOWED
    # VERTICAL KANA REPEAT WITH VOICED SOUND MARK\n 3033; DISALLOWED # VERTICAL KANA
    REPEAT MARK UPPER HALF\n 3034; DISALLOWED # VERTICAL KANA REPEAT WITH VOICED SOUND
    MARK UPPER HA\n 3035; DISALLOWED # VERTICAL KANA REPEAT MARK LOWER HALF\n 303B;
    DISALLOWED # VERTICAL IDEOGRAPHIC ITERATION MARK\n"
  title: 2.6.  Exceptions (F)
- contents:
  - "2.7.  BackwardCompatible (G)\n   G: cp is in {}\n   This category includes the
    code points that property values in\n   versions of Unicode after 5.2 have changed
    in such a way that the\n   derived property value would no longer be PVALID or
    DISALLOWED.  If\n   changes are made to future versions of Unicode so that code
    points\n   might change the property value from PVALID or DISALLOWED, then this\n
    \  table can be updated and keep special exception values so that the\n   property
    values for code points stay stable.\n"
  title: 2.7.  BackwardCompatible (G)
- contents:
  - "2.8.  JoinControl (H)\n   H: Join_Control(cp) = True\n   This category consists
    of Join Control characters (i.e., they are not\n   in LetterDigits (Section 2.1)
    but are still required in IDN labels\n   under some circumstances).\n"
  title: 2.8.  JoinControl (H)
- contents:
  - "2.9.  OldHangulJamo (I)\n   I: Hangul_Syllable_Type(cp) is in {L, V, T}\n   This
    category consists of all conjoining Hangul Jamo (Leading Jamo,\n   Vowel Jamo,
    and Trailing Jamo).\n   Elimination of conjoining Hangul Jamo from the set of
    PVALID\n   characters results in restricting the set of Korean PVALID characters\n
    \  just to preformed, modern Hangul syllable characters.  Old Hangul\n   syllables,
    which must be spelled with sequences of conjoining Hangul\n   Jamo, are not PVALID
    for IDNs.\n"
  title: 2.9.  OldHangulJamo (I)
- contents:
  - "2.10.  Unassigned (J)\n   J: General_Category(cp) is in {Cn} and\n      Noncharacter_Code_Point(cp)
    = False\n   This category consists of code points in the Unicode character set\n
    \  that are not (yet) assigned.  It should be noted that Unicode\n   distinguishes
    between \"unassigned code points\" and \"unassigned\n   characters\".  The unassigned
    code points are all but (Cn -\n   Noncharacters), while the unassigned *characters*
    are all but (Cn +\n   Cs).\n"
  title: 2.10.  Unassigned (J)
- contents:
  - "3.  Calculation of the Derived Property\n   As described above (Section 1) and
    in more detail in the IDNA\n   Protocol document [RFC5891], possible values of
    the IDN property are:\n   o  PVALID\n   o  CONTEXTJ\n   o  CONTEXTO\n   o  DISALLOWED\n
    \  o  UNASSIGNED\n   The algorithm to calculate the value of the derived property
    is as\n   follows.  If the name of a rule (such as Exception) is used, that\n
    \  implies the set of code points that the rule defines, while the same\n   name
    as a function call (such as Exception(cp)) implies the value cp\n   has in the
    Exceptions table.\n   If .cp. .in.  Exceptions Then Exceptions(cp);\n   Else If
    .cp. .in.  BackwardCompatible Then BackwardCompatible(cp);\n   Else If .cp. .in.
    \ Unassigned Then UNASSIGNED;\n   Else If .cp. .in.  LDH Then PVALID;\n   Else
    If .cp. .in.  JoinControl Then CONTEXTJ;\n   Else If .cp. .in.  Unstable Then
    DISALLOWED;\n   Else If .cp. .in.  IgnorableProperties Then DISALLOWED;\n   Else
    If .cp. .in.  IgnorableBlocks Then DISALLOWED;\n   Else If .cp. .in.  OldHangulJamo
    Then DISALLOWED;\n   Else If .cp. .in.  LetterDigits Then PVALID;\n   Else DISALLOWED;\n"
  title: 3.  Calculation of the Derived Property
- contents:
  - "4.  Code Points\n   The categories and rules defined in Sections 2 and 3 apply
    to all\n   Unicode code points.  The table in Appendix B shows, for illustrative\n
    \  purposes, the consequences of the categories and classification\n   rules,
    and the resulting property values.\n   The list of code points that can be found
    in Appendix B is\n   non-normative.  Sections 2 and 3 are normative.\n"
  title: 4.  Code Points
- contents:
  - '5.  IANA Considerations

    '
  title: 5.  IANA Considerations
- contents:
  - "5.1.  IDNA-Derived Property Value Registry\n   IANA has created a registry with
    the derived properties for the\n   versions of Unicode released after (and including)
    version 5.2.  The\n   derived property value is to be calculated in cooperation
    with a\n   designated expert [RFC5226] according to the specifications in\n   Sections
    2 and 3 and not by copying the non-normative table found in\n   Appendix B.\n
    \  If non-backward-compatible changes or other problems arise during the\n   creation
    or designated expert review of the table of derived property\n   values, they
    should be flagged for the IESG.  Changes to the rules\n   (as specified in Sections
    2 and 3), including BackwardCompatible\n   (Section 2.7) (a set that is at release
    of this document is empty)\n   require IETF Review, as described in RFC 5226 [RFC5226].\n"
  title: 5.1.  IDNA-Derived Property Value Registry
- contents:
  - "5.2.  IDNA Context Registry\n   For characters that are defined in the IDNA derived
    property value\n   registry (Section 5.1) as CONTEXTO or CONTEXTJ and that therefore\n
    \  require a contextual rule, IANA has created and now maintains a list\n   of
    approved contextual rules.  Additions or changes to these rules\n   require IETF
    Review, as described in [RFC5226].\n   Appendix A contains further discussion
    and a table from which that\n   registry can be initialized.\n"
  title: 5.2.  IDNA Context Registry
- contents:
  - "5.2.1.  Template for Context Registry\n   The following information is to be
    given when a new rule is created.\n      Name: Unique name of the rule\n      Code
    point: Rule that should be applied when this code point\n      exists in the label\n
    \     Overview: Description in plain English on what the rule verifies\n      Lookup:
    Should the rule be applied at time of lookup?\n      Rule Set: The set of rules,
    with a reference to the defining\n      document.\n"
  title: 5.2.1.  Template for Context Registry
- contents:
  - "6.  Security Considerations\n   Security Considerations for this version of IDNA,
    except for the\n   special issues associated with right-to-left scripts and characters,\n
    \  are described in the Definitions document [RFC5890].  Specific issues\n   for
    labels containing characters associated with scripts written\n   right to left
    appear in the Bidi document [RFC5893].\n"
  title: 6.  Security Considerations
- contents:
  - "7.  Acknowledgements\n   This document would not have been possible to produce
    without input\n   from many people.  The main contributors are (in alphabetical
    order)\n   Harald Alvestrand, Vint Cerf, Tina Dam, Mark Davis, Gihan Dias,\n   Mouhammet
    Diop, Michael Everson, Asmus Freytag, Debbie Garside, Paul\n   Hoffman, Kent Karlsson,
    Cary Karp, Jaeyoun Kim, John Klensin, Olaf\n   Kolkman, Gervase Markham, Ram Mohan,
    Lisa Moore, Yngve Pettersen,\n   Erik van der Poel, Hualin Qian, Rick Reed, Pete
    Resnick, Lakmal\n   Silva, Michel Suignard, Andrew Sullivan, Wil Tan, Kenneth
    Whistler,\n   Chris Wright, and Yoshiro Yoneya.\n"
  title: 7.  Acknowledgements
- contents:
  - "Appendix A.  Contextual Rules Registry\n   As discussed in Section 5.2 and in
    the IANA Considerations section of\n   the Rationale document [RFC5894], a registry
    of rules that define the\n   contexts in which particular PROTOCOL-VALID characters,
    characters\n   associated with a requirement for Contextual Information, are\n
    \  permitted.  These rules are expressed as tests on the label in which\n   the
    characters appear (all, or any part of, the label may be tested).\n   The grammatical
    rules are expressed in pseudo-code.  The conventions\n   used for that pseudo-code
    are explained here.\n   Each rule is constructed as a Boolean expression that
    evaluates to\n   either True or False.  A simple \"True;\" or \"False;\" rule
    sets the\n   default result value for the rule set.  Subsequent conditional rules\n
    \  that evaluate to True or False may re-set the result value.\n   A special value
    \"Undefined\" is used to deal with any error\n   conditions, such as an attempt
    to test a character before the start\n   of a label or after the end of a label.
    \ If any term of a rule\n   evaluates to Undefined, further evaluation of the
    rule immediately\n   terminates, as the result value of the rule will itself be
    Undefined.\n      cp represents the code point to be tested.\n      FirstChar
    is a special term that denotes the first code point in a\n      label.\n      LastChar
    is a special term that denotes the last code point in a\n      label.\n      .eq.
    represents the equality relation.\n         A .eq.  B evaluates to True if A equals
    B.\n      .is. represents checking the position in a label.\n         A .is.  B
    evaluates to True if A and B have same position in\n         the same label.\n
    \     .ne. represents the non-equality relation.\n         A .ne.  B evaluates
    to True if A is not equal to B.\n      .in. represents the set inclusion relation.\n
    \        A .in.  B evaluates to True if A is a member of the set B.\n   A functional
    notation, Function_Name(cp), is used to express either\n   string positions within
    a label, Boolean character property tests of\n   a code point, or a regular expression
    match.  When such function\n   names refer to Boolean character property tests,
    the function names\n   use the exact Unicode character property name for the property
    in\n   question, and \"cp\" is evaluated as the Unicode value of the code\n   point
    to be tested, rather than as its position in the label.  When\n   such function
    names refer to string positions within a label, \"cp\" is\n   evaluated as its
    position in the label.\n   RegExpMatch(X) takes as its parameter X a schematic
    regular\n   expression consisting of a mix of Unicode character property values\n
    \  and literal Unicode code points.\n   Script(cp) returns the value of the Unicode
    Script property, as\n   defined in Scripts.txt in the Unicode Character Database.\n
    \  Canonical_Combining_Class(cp) returns the value of the Unicode\n   Canonical_Combining_Class
    property, as defined in UnicodeData.txt in\n   the Unicode Character Database.\n
    \  Before(cp) returns the code point of the character immediately\n   preceding
    cp in logical order in the string representing the label.\n   Before(FirstChar)
    evaluates to Undefined.\n   After(cp) returns the code point of the character
    immediately\n   following cp in logical order in the string representing the label.\n
    \  After(LastChar) evaluates to Undefined.\n   Note that \"Before\" and \"After\"
    do not refer to the visual display\n   order of the character in a label, which
    may be reversed or otherwise\n   modified by the bidirectional algorithm for labels
    including\n   characters from scripts written right to left.  Instead, \"Before\"
    and\n   \"After\" refer to the network order of the character in the label.\n
    \  The clauses \"Then True\" and \"Then False\" imply exit from the\n   pseudo-code
    routine with the corresponding result.\n   Repeated evaluation for all characters
    in a label makes use of the\n   special construct:\n      For All Characters:\n
    \        Expression;\n      End For;\n   This construct requires repeated evaluation
    of \"Expression\" for each\n   code point in the label, starting from FirstChar
    and proceeding to\n   LastChar.\n   The different fields in the rules are to be
    interpreted as follows:\n   Code point:\n      The code point, or code points,
    to which this rule is to be\n      applied.  Normally, this implies that if any
    of the code points in\n      a label is as defined, then the rules should be applied.
    \ If\n      evaluated to True, the code point is OK as used; if evaluated to\n
    \     False, it is not OK.\n   Overview:\n      A description of the goal with
    the rule, in plain English.\n   Lookup:\n      True if application of this rule
    is recommended at lookup time;\n      False otherwise.\n   Rule Set:\n      The
    rule set itself, as described above.\n"
  title: Appendix A.  Contextual Rules Registry
- contents:
  - "Appendix A.1.  ZERO WIDTH NON-JOINER\n   Code point:\n      U+200C\n   Overview:\n
    \     This may occur in a formally cursive script (such as Arabic) in a\n      context
    where it breaks a cursive connection as required for\n      orthographic rules,
    as in the Persian language, for example.  It\n      also may occur in Indic scripts
    in a consonant-conjunct context\n      (immediately following a virama), to control
    required display of\n      such conjuncts.\n   Lookup:\n      True\n   Rule Set:\n
    \     False;\n      If Canonical_Combining_Class(Before(cp)) .eq.  Virama Then
    True;\n      If RegExpMatch((Joining_Type:{L,D})(Joining_Type:T)*\\u200C\n         (Joining_Type:T)*(Joining_Type:{R,D}))
    Then True;\n"
  title: Appendix A.1.  ZERO WIDTH NON-JOINER
- contents:
  - "Appendix A.2.  ZERO WIDTH JOINER\n   Code point:\n      U+200D\n   Overview:\n
    \     This may occur in Indic scripts in a consonant-conjunct context\n      (immediately
    following a virama), to control required display of\n      such conjuncts.\n   Lookup:\n
    \     True\n   Rule Set:\n      False;\n      If Canonical_Combining_Class(Before(cp))
    .eq.  Virama Then True;\n"
  title: Appendix A.2.  ZERO WIDTH JOINER
- contents:
  - "Appendix A.3.  MIDDLE DOT\n   Code point:\n      U+00B7\n   Overview:\n      Between
    'l' (U+006C) characters only, used to permit the Catalan\n      character ela
    geminada to be expressed.\n   Lookup:\n      False\n   Rule Set:\n      False;\n
    \     If Before(cp) .eq.  U+006C And\n         After(cp) .eq.  U+006C Then True;\n"
  title: Appendix A.3.  MIDDLE DOT
- contents:
  - "Appendix A.4.  GREEK LOWER NUMERAL SIGN (KERAIA)\n   Code point:\n      U+0375\n
    \  Overview:\n      The script of the following character MUST be Greek.\n   Lookup:\n
    \     False\n   Rule Set:\n      False;\n      If Script(After(cp)) .eq.  Greek
    Then True;\n"
  title: Appendix A.4.  GREEK LOWER NUMERAL SIGN (KERAIA)
- contents:
  - "Appendix A.5.  HEBREW PUNCTUATION GERESH\n   Code point:\n      U+05F3\n   Overview:\n
    \     The script of the preceding character MUST be Hebrew.\n   Lookup:\n      False\n
    \  Rule Set:\n      False;\n      If Script(Before(cp)) .eq.  Hebrew Then True;\n"
  title: Appendix A.5.  HEBREW PUNCTUATION GERESH
- contents:
  - "Appendix A.6.  HEBREW PUNCTUATION GERSHAYIM\n   Code point:\n      U+05F4\n   Overview:\n
    \     The script of the preceding character MUST be Hebrew.\n   Lookup:\n      False\n
    \  Rule Set:\n      False;\n      If Script(Before(cp)) .eq.  Hebrew Then True;\n"
  title: Appendix A.6.  HEBREW PUNCTUATION GERSHAYIM
- contents:
  - "Appendix A.7.  KATAKANA MIDDLE DOT\n   Code point:\n      U+30FB\n   Overview:\n
    \     Note that the Script of Katakana Middle Dot is not any of\n      \"Hiragana\",
    \"Katakana\", or \"Han\".  The effect of this rule is to\n      require at least
    one character in the label to be in one of those\n      scripts.\n   Lookup:\n
    \     False\n   Rule Set:\n      False;\n      For All Characters:\n         If
    Script(cp) .in. {Hiragana, Katakana, Han} Then True;\n      End For;\n"
  title: Appendix A.7.  KATAKANA MIDDLE DOT
- contents:
  - "Appendix A.8.  ARABIC-INDIC DIGITS\n   Code point:\n      0660..0669\n   Overview:\n
    \     Can not be mixed with Extended Arabic-Indic Digits.\n   Lookup:\n      False\n
    \  Rule Set:\n      True;\n      For All Characters:\n         If cp .in. 06F0..06F9
    Then False;\n      End For;\n"
  title: Appendix A.8.  ARABIC-INDIC DIGITS
- contents:
  - "Appendix A.9.  EXTENDED ARABIC-INDIC DIGITS\n   Code point:\n      06F0..06F9\n
    \  Overview:\n      Can not be mixed with Arabic-Indic Digits.\n   Lookup:\n      False\n
    \  Rule Set:\n      True;\n      For All Characters:\n         If cp .in. 0660..0669
    Then False;\n      End For;\n"
  title: Appendix A.9.  EXTENDED ARABIC-INDIC DIGITS
- contents:
  - "Appendix B.  Code Points 0x0000 - 0x10FFFF\n   If one applies the rules (Section
    3) to the code points 0x0000 to\n   0x10FFFF to Unicode 5.2, the result is as
    follows.\n   This list is non-normative, and only included for illustrative\n
    \  purposes.  Specifically, what is displayed in the third column is not\n   the
    formal name of the code point (as defined in Section 4.8 of The\n   Unicode Standard
    [Unicode52]).  The differences exist, for example,\n   for the code points that
    have the code point value as part of the\n   name (for example, CJK UNIFIED IDEOGRAPH-4E00)
    and the naming of\n   Hangul syllables.  For many code points, what you see is
    the official\n   name.\n"
  title: Appendix B.  Code Points 0x0000 - 0x10FFFF
